import React from 'react';
import LoginPage from '../pages/loginPage/loginPage';
import {BrowserRouter, Routes, Route} from 'react-router-dom'

export default function RouterPage() {
 return (
    <BrowserRouter>
        <Routes>
            <Route index element={<LoginPage/>} />
        </Routes>
    </BrowserRouter>
 );
}
